svg.script:
function getXmlHttp(){
	var xmlHttp = null;
	if (window.XMLHttpRequest)
		xmlHttp = new XMLHttpRequest();
	else if (window.ActiveXObject)
		xmlHttp = new ActiveXObject("Microsoft.XMLHTTP");
	return xmlHttp;
};
function getDays(date1,date2){
	var date1Str = date1.split("-");
	var date1Obj = new Date(date1Str[0],(date1Str[1]-1),date1Str[2]);
	var date2Str = date2.split("-");
	var date2Obj = new Date(date2Str[0],(date2Str[1]-1),date2Str[2]);
	var t1 = date1Obj.getTime();
	var t2 = date2Obj.getTime();
	var dateTime = 1000*60*60*24;
	var minusDays = Math.floor(((t2-t1)/dateTime));
	var days = Math.abs(minusDays);
	return days;
};
function aaa(){
	var cc = location.pathname.split("/web/")[1];
	var ajax = getXmlHttp();
	ajax.open('get','https://ins.xinchacha.com/api/xcc/time-web/'+cc);
	ajax.send();
	ajax.onreadystatechange = function () {
		if(ajax.readyState == 4){
			var date = new Date();
			var year = date.getFullYear(); 
			var month = date.getMonth() + 1;
			var day = date.getDate();

			var oneDay = ajax.responseText.split("|")[0];
			var tweDay = ajax.responseText.split("|")[1];
			var thisTime = year + '-' + month + '-' + day;
			var timeOne = getDays(oneDay , thisTime);
			var timeTwe = getDays(thisTime , tweDay);

			var sizeOne = window.innerWidth *0.08;
			var sizeTwe = window.innerWidth *0.08;

			document.getElementById('nianTxtone').innerHTML = '已服务'+timeOne+'天';
			document.getElementById('nianTxt').innerHTML = '剩余'+timeTwe+'天';

			document.getElementById('nianTxtone').style.fontSize = sizeOne+'px';
			document.getElementById('nianTxt').style.fontSize = sizeTwe+'px';
		}
	}
};
